        completedTodos,
        totalTodos,
    } = React.useContext(TodoContext)
    return (
        <>
                <h4> Hi, <span>Eduardo!</span></h4>
                <h2> Your <span>tasks</span> <br/>completed {completedTodos} of {totalTodos}</h2>
        </>
    )
}
